import { FaLinkedin, FaGithub, FaAt } from "react-icons/fa"

export default {
  myFooterData: [
    {
      title: 'Email',
      icon: <FaAt />,
      link: 'email:fabiosgcontato@gmail.com'
    },
    {
      title: 'LinkedIn',
      icon: <FaLinkedin />,
      link: 'https://www.linkedin.com/in/f%C3%A1bio-signorini-63b4b4178/'
    },
    {
      title: 'GitHub',
      icon: <FaGithub />,
      link: 'email:fabiosgcontato@gmail.com'
    },
  ]
}
